"use strict";
class MathOperations {
    static Pi = Math.PI;
    static add(num1, num2) {
        return num1 + num2;
    }
    static sub(num1, num2) {
        return num1 + num2;
    }
}
console.log(MathOperations.Pi);
console.log(MathOperations.add(12, 13));
console.log(MathOperations.sub(13, 12));
